@Injectable()
export class HighlightService {

  constructor(@Inject(PLATFORM_ID) private platformId: Object) {

  }

  public highlightAll() {
    if (isPlatformBrowser(this.platformId)) {
      Prism.highlightAll();
    }
  }

  public highlight(source: string, language = 'typescript'): string {
    if (isPlatformBrowser(this.platformId) && source) {
      return Prism.highlight(source, Prism.languages[language], language);
    }
    return source;
  }
}

import { Injectable } from '@angular/core';
import { Meta, MetaDefinition, Title } from '@angular/platform-browser';
import { META_PROPS } from './constants';
import { MetaInfo, MetaProp, MetaPropertyType } from './meta.interface';

@Injectable()
export class MetaService {

  constructor(private meta: Meta, private title: Title) { }

  private getTagAsString(metaDefinition: MetaDefinition): string {
    let keyName = '';
    if (metaDefinition.property) {
      keyName = 'property';
    } else if (metaDefinition.httpEquiv) {
      keyName = 'http-equiv';
    } else {
      keyName = 'name';
    }

    return `<meta ${keyName}="${metaDefinition[keyName === 'http-equiv' ? 'httpEquiv' : keyName]}" content="${metaDefinition.content}">`;
  }

  private generateAllMetaDefinitions(pageMeta: MetaInfo = {}): Array<MetaDefinition> {
    const metaDefinitions: Array<MetaDefinition> = [];
    const metaProps = META_PROPS.map(p => ({ ...p }));

    metaProps.forEach((p: MetaProp) => {
      const content = pageMeta[p.name];
      if (content){
        p.types.forEach((t: MetaPropertyType) => {
          const metaDefinition: MetaDefinition = {};
          metaDefinition[t.type] = t.subType ? `${t.subType}:${p.name}` : p.name;
          metaDefinition.content = content;
          metaDefinitions.push(metaDefinition);
        })
      }
    });

    return metaDefinitions;
  }

  public getTagsAsString(pageMeta: MetaInfo): Array<string> {
    const metaDefinitions = this.generateAllMetaDefinitions(pageMeta);

    return metaDefinitions.map(m => this.getTagAsString(m));
  }

  public setPageMeta(pageMeta: MetaInfo): Array<HTMLMetaElement> {
    const metaDefinitions = this.generateAllMetaDefinitions(pageMeta);
    this.title.setTitle(pageMeta?.title);
    return this.meta.addTags(metaDefinitions);
  }
}

import { Inject, Injectable } from '@angular/core';
import { Link, ImageInfo} from '../../../common-ui';
import { Observable, Subject } from 'rxjs';
import { DOCUMENT } from '@angular/common';
import { Rectangle } from '../content-editor.interface';

@Injectable({
  providedIn: 'root'
})
export class SelectionService {
  private savedSelection: Array<Range>;
  private _selection = new Subject<boolean>();

  constructor(@Inject(DOCUMENT) private document: Document) { }

  // Get the deepest Element node in the DOM tree that contains the entire range.
  private getRangeContainer(range: Range): Node {
    let container = range.commonAncestorContainer;
    // If the selected node is a Text node, climb up to an element node - in Internet
    // Explorer, the .contains() method only works with Element nodes.
    while (container && container.nodeName !== 'ANU-CONTENT-EDITOR') {
      container = container.parentNode;
    }

    return container;
  }

  private restoreSelection(savedSel: Array<Range>): Selection {
    if (savedSel) {
      const selection: Selection = this.document.getSelection();
      selection.removeAllRanges();
      for (var i = 0, len = savedSel.length; i < len; ++i) {
        selection.addRange(savedSel[i]);
      }
      return selection;
    }

    return;
  }

  private isImageInSelection(selection: Selection) {
    if (!selection || !selection.rangeCount) return false;

    const range = selection.getRangeAt(0);

    // check if selection contains an image, if yes then Image should also be the hyperlink.
    const fragment = range.cloneContents();
    const imgs = fragment.querySelectorAll('img');

    if (imgs && imgs.length) return true

    return false;
  }

  public get selection() : Observable<boolean> {
    return this._selection.asObservable();
  }

  public get selectionText() : string {
    this.restoreSelection(this.savedSelection);
    return this.document.getSelection().toString();
  }

  // You can save selection because when you focus on some other element, current selection gets lost,
  // so you can save it and restore it for processing.
  public saveSelection(selection: Selection) {
    var ranges: Array<Range> = [];
    for (var i = 0, len = selection.rangeCount; i < len; ++i) {
      ranges.push(selection.getRangeAt(i));
    }
    this.savedSelection = ranges;

    if (selection.toString() || this.isImageInSelection(selection)) {
      this._selection.next(true);
    } else {
      this._selection.next(false);
    }
  }

  public getSelectionRect(): Rectangle | null {
    const selection = this.restoreSelection(this.savedSelection);
    if (!selection || selection.type !== 'Range' || !selection.rangeCount) {
      return;
    }

    // // save selection for later use
    // this.saveSelection(selection);

    // Calculate the selection bounding rectangle
    const range = selection.getRangeAt(0);
    const rangeContainer = this.getRangeContainer(range) as Element;
    if (!rangeContainer) {
      return;
    }
    const rangeRect = range.getBoundingClientRect();
    const rangeContainerRect = rangeContainer.getBoundingClientRect();
    const selectionRect: Rectangle = {
      left: rangeRect.left - rangeContainerRect.left,
      top: rangeRect.top - rangeContainerRect.top,
      bottom: rangeRect.top - rangeContainerRect.top + rangeRect.height,
      right: rangeRect.left - rangeContainerRect.left + rangeRect.width,
      width: rangeRect.width,
      height: rangeRect.height,
    };

    return selectionRect;
  }


  public addLink(link: Link) {
    const selection = this.restoreSelection(this.savedSelection);
    if (!selection || selection.type !== 'Range' || !selection.rangeCount) {
      return;
    }

    const selectionText = selection.toString();
    if (!selectionText && !this.isImageInSelection(selection)) {
      return;
    }

    const range = selection.getRangeAt(0);

    // check if selection contains an image, if yes then Image should also be the hyperlink.
    const fragment = range.cloneContents();
    const imgs = fragment.querySelectorAll('img');
    let linkContentNode: any = this.document.createTextNode(link.label);
    if (imgs && imgs.length) {
      linkContentNode = fragment;
    }

    // create a new Link
    var newLink = this.document.createElement("a");
    newLink.target = link.target;
    newLink.href = link.href;
    newLink.title = link.title;
    newLink.appendChild(linkContentNode);

    // replace selection with Link
    range.deleteContents();
    range.insertNode(newLink);
  }

  public addImage(image: ImageInfo) {
    const selection = this.restoreSelection(this.savedSelection);
    if (!selection || selection.type !== 'Range' || !selection.rangeCount) {
      return;
    }

    const selectionText = selection.toString();
    if (!selectionText && !this.isImageInSelection(selection)) {
      return;
    }

    const range = selection.getRangeAt(0);

    // create a new Image
    var newImage = this.document.createElement("img");
    newImage.src = image.src;
    newImage.alt = image.alt;
    // newImage.appendChild(newImage);

    // replace selection with Image
    range.deleteContents();
    range.insertNode(newImage);
  }

  public addFormating(tagName: string) {
    const selection = this.restoreSelection(this.savedSelection);
    if (!selection || selection.type !== 'Range' || !selection.rangeCount) {
      return;
    }

    const selectionText = selection.toString();
    if (!selectionText) {
      return;
    }

    const range = selection.getRangeAt(0);

    // create a new formatting Element
    var newEl = this.document.createElement(tagName);
    var textNode = this.document.createTextNode(selectionText);
    newEl.appendChild(textNode);

    // replace selection with new formatting element
    range.deleteContents();
    range.insertNode(newEl);
  }
}

import { DOCUMENT } from '@angular/common';
import { Inject, Injectable, PLATFORM_ID, Renderer2, RendererFactory2, RendererStyleFlags2 } from '@angular/core';
import { BehaviorSubject, Observable } from 'rxjs';
import { isPlatformBrowser } from '@angular/common';

import themes from '../../../themes';
import { PaletteColor, Typography, CssVar, ColorPalette } from './theme.interface';
import { Theme } from './theme.interface';

const DEFAULT_THEME = 'default';
const PALETTE_COLOR_COUNT = 8;
const PALETTE_LIGHTNESS_START = 10;
const PALETTE_SHADES = ['DeepDark', 'Darkest', 'Darker', 'Dark', 'Normal', 'Light', 'Lighter', 'Lightest', 'DeepLight'];
const CSS_VARIABLES_PREFIX = '--anu-';

@Injectable({
  providedIn: 'root'
})
export class ThemeService {
  private renderer: Renderer2;
  private selectedThemeName: BehaviorSubject<string>;
  private isBrowser: boolean;

  constructor(@Inject(DOCUMENT) private document: Document, @Inject(PLATFORM_ID) private platformId: Object, private rendererFactory: RendererFactory2) {
    this.isBrowser = isPlatformBrowser(this.platformId);
    this.renderer = this.rendererFactory.createRenderer(null, null);
    this.selectedThemeName = new BehaviorSubject<string>('');
    this.selectedThemeName.subscribe(themeName => this.loadTheme(themeName));
  }

  // Replaces all upperCase letters to lowercase precided with '-' dash
  private camelCaseToDashCase(str: string): string {
    if (!str) return '';
    return str.split('').map(c => c === c.toUpperCase() ? `-${c.toLowerCase()}` : c).join('');
  }

  /*
  * get css var name and value.
  */
  private getCssVar(name: string, value: string = ''): CssVar {
    if (!name) {
      return;
    }

    if (value) {

      name = CSS_VARIABLES_PREFIX + this.camelCaseToDashCase(name);
      return { name, value } as CssVar;
    }

    return;
  }

  /*
  * write a css variable to DOM
  */
  private writeCssVarToDom(name: string, value: string = ''): void {
    const cssVar = this.getCssVar(name, value);
    if (cssVar) {
      this.renderer.setStyle(this.document.documentElement, cssVar.name, cssVar.value, RendererStyleFlags2.DashCase);
    }
  }

  /*
  * Loads the selected theme json from themes folder, and writes all css variables to DOM
  */
  private loadTheme(themeName: string): boolean {
    let theme = themes[themeName] as Theme;
    if (!theme) {
      return false;
    }
    // Write Color CSS variables to DOM
    theme.colorPalettes.forEach(cp => {
      cp.colors.forEach(c => {
        this.writeCssVarToDom(`${cp.name}${c.name}`, c.hsl)
      })
    })
    // Write Typography CSS variables to DOM
    theme.typography.forEach(tp => {
      this.writeCssVarToDom(tp.name, tp.value);
    })

    return true;
  }

  /*
   * returns a list of css vars as combined string of name and value
   */
  public getCssVars(theme: Theme): Array<string> {
    const cssVars: Array<string> = [];
    // get Color CSS variables
    theme.colorPalettes.forEach(cp => {
      cp.colors.forEach(c => {
        const cssVar = this.getCssVar(`${cp.name}${c.name}`, c.hsl);
        cssVars.push(`${cssVar.name}: ${cssVar.value}`);
      })
    })
    // get Typography CSS variables
    theme.typography.forEach(tp => {
      const cssVar = this.getCssVar(tp.name, tp.value);
      cssVars.push(`${cssVar.name}: ${cssVar.value}`);
    })
    return cssVars;
  }

  /*
  * returns the Available themes as an Array
  */
  public get themes(): Array<Theme> {
    return Object.values(themes);
  }

  public get theme(): string {
    return this.selectedThemeName.getValue();
  }

  public get paletteShades(): Array<string> {
    return PALETTE_SHADES;
  }

  /*
  * returns the primary Theme Color code. basically primaryNormal color code
  */
  public getThemeColor(theme: Theme): string {
    let themeColor: string;
    const primaryPalette: ColorPalette = theme.colorPalettes.find(cp => cp.name === 'primary') || {} as ColorPalette;
    const primaryNormal: PaletteColor = primaryPalette.colors.find(c => c.name === 'Normal')

    return primaryNormal.hsl;
  }

  public getTheme(): Observable<string> {
    return this.selectedThemeName.asObservable();
  }

  public setTheme(themeName: string = '', forced: boolean = true): void {

    if (!forced) {
      if (typeof window !== 'undefined') {
        themeName = window.localStorage.getItem('selectedThemeName') || themeName;
      }

      if (!themes[themeName]) {
        themeName = DEFAULT_THEME;
      }
    } else if (!themes[themeName]) {
      themeName = DEFAULT_THEME;
    }

    if (typeof window !== 'undefined') {
      window.localStorage.setItem('selectedThemeName', themeName);
    }

    this.selectedThemeName.next(themeName);
  }

  public toggleInvert(invert: boolean): void {
    if (invert === true) {
      this.document.documentElement.style.setProperty('filter', 'invert(1) brightness(0.6)');
    } else {
      this.document.documentElement.style.setProperty('filter', '');
    }
  }

  public getPaletteColors(hue: number, saturation: number): Array<PaletteColor> {
    /**
     * Hue 0 - 360 degree
     * Saturation - 0% - 100%
     * Lightness - 0% - 100%
     */
    const colors = [];

    const factoringNumer = (99 - PALETTE_LIGHTNESS_START) / PALETTE_COLOR_COUNT; // equal portions of 100%
    for (let i = 0; i <= PALETTE_COLOR_COUNT; i++) {
      const l = PALETTE_LIGHTNESS_START + (i * factoringNumer);
      const paletteColor: PaletteColor = {
        name: PALETTE_SHADES[i],
        hsl: `hsl(${hue}, ${saturation}%, ${l}%)`
      }

      colors.push(paletteColor);
    }

    return colors;
  }
}

